const Skills=()=>{
    return(
        <div className="mt-12  flex flex-col items-center gap-4 p-10">
            <div className="flex justify-center items-center border-2 bg-grey-5-- rounded-lg  h-7 py-1 px-5">Skills</div>
            <div>The skills, tools and technologies I am really good at:</div>
            <div> 
                <Logo/>
            </div>

        </div>
    )
}
export default Skills
